class Letter extends Component {
    constructor(){
        super()
        this.letter = ""
    }

    defineLetter(letter){
        this.letter = letter
    }

    render() {
        this.defineLetter(this.props.let)
        return (
            <div>
                {this.letter}   
            </div>
        );
    }
}

export default Letter;
